import React, { Component } from 'react';

import Table from './components/Table/Table';
import Button from './components/Button/Button';

import classes from './components/Button/Button.css';



class App extends Component {

  render() {

    return (
      <div>

       <div className={classes.heading}>  ReactJS Dynacally add/remove items from Table </div>
      <button type="button" onClick={this.props.onRowAdd} className={classes.Button}>Add Item</button>

      </div>
    );

  }
}
export default App;
